import React from 'react';


const Question = (props) => {

    const questions = props.questionsList.map((questions) => {
        return (
            <li key={questions.id}>Question : {questions.title}</li>
        )
    })

    return (
        <ul>
            {questions}
        </ul>
    )
}

export default Question;
